  \"2015-12-03T05:05:39.578142\",\n\t\"name\": \"icc-vehicle-volume-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset shows the number of vehicles
  that have passed under a gantry on that particular day. This dataset does not show
  trips, it only shows segments. Segments are compiled to make trips. There are 10
  gantries on the InterCounty Connector (ICC) and 5 interchanges. rnrnThe eastbound
  gantries are 101, 105, 107, 109, 113, and thernwestbound gantries are 102, 106,
  108, 110, 114. rnrnThe dataset has a column for each gantry going east and west,
  then a total for each gantry. rnrnThe ICC is an all electronic tolling road which
  opened February 2011. The first opening was a partial opening, with only the first
  interchange being available for use.There was a free period from February 23, 2011
  through March 6, 2011. The rest of the ICC opened in November 2011, and there was
  another free period from November 22, 2011 through December 4, 2011.rnrnThere are
  a few days where a low number of traffic passed under gantries (rows 196,198, 269,271...),
  these were either testing periods or construction vehicles.\",\n\t\"license_title\":
